// main.js
import Vue from 'vue';
import App from './App.vue';
import store from './store/app'; // Import your Vuex store module
import Vuex from 'vuex';
import router from '@/router';
import Vuetify from 'vuetify';
import 'vuetify/dist/vuetify.min.css'; // Ensure you have the CSS file imported

Vue.config.productionTip = false;

Vue.use(Vuetify);

const vuetify = new Vuetify({
  theme: {
    dark: false, // Set to true for dark mode
  },
});

// Create and register the Vuex store instance
const vuexStore = new Vuex.Store({
  modules: {
    app: store, // Register your store module
  },
});

new Vue({
  render: (h) => h(App),
  store: vuexStore, // Use the created Vuex store instance
  router, // Use Vue Router
  vuetify, // Use Vuetify
}).$mount('#app');
